//SPDX-License-Identifier: Unlicense
pragma solidity ^0.8.0;

import "./DesignateVault.sol";

contract LiquidityVault is DesignateVault {
  constructor(address _tosAddress) DesignateVault("Liquidity", _tosAddress) {}
}
